import React from "react";
import { Link } from "react-router-dom";
import DateRangePicker from "./ReactDatePicker";

export default function Home() {
  return (
    <div>
      <div className="flex-container">
        <div>Travel together</div>
      </div>

      <div className="img">
        <img src={process.env.PUBLIC_URL + "/photos/headliner.jpg"} alt="Banner" />
      </div>

      <h1 className="centered">Travel Website</h1>
      <p className="centered">Find The Right Destination For You</p>

      <div className="flex-container">
        <div>Destination</div>
        <div>Stay Period</div>
        <DateRangePicker />
      </div>
    </div>
  );
}
